INSERT INTO `blogs` (`id`, `title`, `content`, `category`, `author`, `created_at`, `image`, `visible`, `display_order`, `view_count`) VALUES
(19, 'Pahami Jenis Lampu dan Fungsinya: Mana yang Tepat untuk Rumah Anda?', 'Lampu memiliki beragam jenis dan fungsi, mulai dari penerangan utama hingga lampu dekoratif. Artikel ini akan membahas berbagai jenis lampu seperti lampu LED, lampu pijar, dan lampu halogen, serta kapan dan di mana masing-masing jenis lampu ini sebaiknya digunakan di rumah Anda. Temukan pilihan terbaik untuk menciptakan atmosfer yang sesuai dengan kebutuhan ruang Anda.', 'Teknologi', 'root', '2024-12-18 07:50:09', , 1, 2, 1),
(20, '5 Trik Memaksimalkan Pencahayaan Rumah dengan Lampu yang Tepat', 'Pencahayaan yang baik dapat mengubah suasana rumah Anda secara dramatis. Dalam blog ini, Anda akan mempelajari cara memaksimalkan fungsi lampu di rumah dengan trik-trik sederhana, mulai dari pemilihan suhu warna lampu hingga penggunaan dimmer. Dapatkan tips-tips praktis untuk meningkatkan kenyamanan dan efisiensi energi di rumah Anda.\r\n\r\n', 'Teknologi', 'root', '2024-12-18 07:50:26', , 1, 3, 1),
(21, 'Lampu Hemat Energi: Solusi Cerdas untuk Rumah dan Lingkungan', 'Di tengah kesadaran akan pentingnya keberlanjutan, lampu hemat energi seperti lampu LED semakin diminati. Artikel ini mengulas keuntungan lampu hemat energi, mulai dari penghematan biaya listrik hingga dampaknya terhadap lingkungan. Pelajari cara memilih dan menggunakan lampu yang ramah lingkungan untuk menciptakan rumah yang lebih hijau dan efisien.\r\n\r\n', 'Teknologi', 'root', '2024-12-18 07:50:48', , 1, 4, 1);
INSERT INTO `blogs` (`id`, `title`, `content`, `category`, `author`, `created_at`, `image`, `visible`, `display_order`, `view_count`) VALUES
(22, 'Mengenal Desain Lampu Minimalis: Simpel, Modern, dan Elegan', 'Desain lampu minimalis telah menjadi tren yang semakin digemari. Artikel ini akan membahas bagaimana lampu dengan desain sederhana namun elegan dapat mempercantik ruangan Anda tanpa berlebihan. Temukan inspirasi desain lampu minimalis untuk menciptakan tampilan modern dan bersih pada interior rumah Anda.', 'Teknologi', 'root', '2024-12-18 07:51:07', , 1, 5, 0),
(23, 'Lampu untuk Setiap Ruang: Tips Memilih Pencahayaan yang Sesuai', 'Setiap ruangan di rumah memiliki kebutuhan pencahayaan yang berbeda. Apakah itu ruang tamu, kamar tidur, atau dapur, pencahayaan yang tepat bisa menambah kenyamanan dan fungsi ruangan. Artikel ini memberikan panduan lengkap untuk memilih lampu yang sesuai dengan setiap jenis ruangan di rumah Anda, serta cara menciptakan pencahayaan yang optimal.\r\n\r\n', 'Teknologi', 'root', '2024-12-18 07:51:27', , 1, 7, 1);
